import React, { useState }  from 'react';


const [num,setNum] = useState(0);

const App = () =>  {
   
   return (
   <>
     <button onClick={()=>{
        setNum(num+1);
     }
     ,
     ()=>{
        alert('i am clicked')
     }}>Click me {num}</button>
   </>
   )
   
}

export default App;
